BEGIN;

drop table if exists quiz;
CREATE TABLE public.quiz (
	id serial NOT NULL,
	code uuid NOT NULL ,
	title varchar(100) NOT NULL,
	description varchar(5000) NOT NULL,
	category varchar(200) NOT NULL,
	created_at timestamp NOT NULL,
	updated_at timestamp NULL,
	CONSTRAINT quiz_pkey PRIMARY KEY (id)
);
CREATE INDEX idx_quiz ON quiz(code);


 -------------------------------------------------------------------------------------


drop table if exists bloc;
CREATE TABLE public.bloc (
	id serial NOT NULL,
	title varchar(100) NOT NULL,
	quiz_id int4 NOT NULL,
	created_at timestamp null,
	CONSTRAINT bloc_pkey PRIMARY KEY (id),

  FOREIGN KEY (quiz_id) REFERENCES quiz (id) ON DELETE CASCADE
);

CREATE INDEX idx_bloc ON public.bloc(id) ;



-----------------------------------------------------------------------------------------------



drop table if exists question;
CREATE TABLE public.question (
	id serial NOT NULL,
	type int4 NOT NULL,
	score int4 NOT NULL,
	question varchar(50) NOT NULL,
	text varchar(5000) NULL DEFAULT NULL::character varying,
	video varchar(5000) NULL DEFAULT NULL::character varying,
	bloc_id int4 NOT NULL,
    type_choice varchar(250) NOT NULL,
    data_choices varchar(500)[] DEFAULT null,
	created_at timestamp null,
	CONSTRAINT question_pkey PRIMARY KEY (id),

  FOREIGN KEY (bloc_id) REFERENCES bloc (id) ON DELETE CASCADE
);

CREATE INDEX idx_question ON public.question(id) ;

-------------------------------------------------------------------------------------------
drop table if exists description;
CREATE TABLE public.description (
	id serial NOT NULL,
	name varchar(500) NOT NULL,
	data varchar(50000) NULL DEFAULT NULL::character varying,
	question_id int4 NOT NULL,
	created_at timestamp null,
	CONSTRAINT description_pkey PRIMARY KEY (id),

  FOREIGN KEY (question_id) REFERENCES question (id) ON DELETE CASCADE
);
CREATE INDEX idx_description ON public.description(id) ;


-----------------------------------------------------------------------------------------------

